#define YY_DECL int yylex YY_PROTO((struct fc_time *fc_list, int *fc_to, int fc_verb))


int
parse_fc_time_string( char * string, double fps, char *separator, 
                      int fc_verb, struct fc_time **fc_list)
{
  struct fc_time * time;
  int fc_to = 0;
  char * hold;

  yy_scan_string( "" );
  hold = strtok( string, separator);

  while( hold != NULL ) {
    yy_scan_string( hold );

    if( ( time = new_fc_time( ) ) == NULL )
      return -1;

    time->sh    = 0;
    time->sm    = 0;
    time->ss    = 0;
    time->sf    = 0;
    time->stf   = 0;
    time->eh    = 0;
    time->em    = 0;
    time->es    = 0;
    time->ef    = 0;
    time->etf   = 0;
    time->stepf = 1;
    time->vob_offset = 0;
    time->next  = NULL;

    time->fps = fps;

    if( *fc_list == NULL )
      *fc_list = time;

    else if( append_fc_time( *fc_list, time ) == -1 )
      return -1;

    if( yylex( *fc_list, &fc_to, fc_verb ) < 0 ) {
      printf( "[%s:%d]syntax error\n", __FILE__, __LINE__ );
      return -1;
    }

    hold = strtok( NULL, separator);
  }

  return 0;
}

int fc_frame_in_time( struct fc_time * list, unsigned int frame ) 
{
    while (list) {
	if (list->stf <= frame && frame < list->etf)
	    return list->stepf;
	else 
	    list = list->next;
    }

    return 0;

}

void
fc_set_start_time( struct fc_time * time, unsigned int frames )
{
  struct fc_time * next;

  if( time != NULL ) {
    time->sh = 0;
    time->sm = 0;
    time->ss = 0;
    time->sf = frames;
    time->stf = 0;
    time->stepf = 1;
    next = time->next;
    time->next = NULL;
    fc_time_normalize( time, 0 );
    time->next = next;
  }
}

void
fc_time_normalize( struct fc_time * list, int fc_verb )
{
  unsigned int th, tm, ts, tf;
  double t;

  while( list != NULL ) {
    // avoid fpu error
    if( list->fps == 0.0 )
      list->fps = 1.0;
    /*
     * start time
     */
    if( list->sf >= list->fps ) {
      list->ss += list->sf / list->fps;
      list->sf -= ( list->fps * (int)( list->sf / list->fps ) );
    }

    if( list->ss >= 60  ) {
      list->sm += list->ss / 60;
      list->ss -= ( 60  * ( list->ss / 60  ) );
    }

    if( list->sm >= 60  ) {
      list->sh += list->sm / 60;
      list->sm -= ( 60  * ( list->sm / 60  ) );
    }

    list->stf = list->sh * 3600 * list->fps + 
                list->sm *   60 * list->fps + 
		            list->ss * list->fps        + 
			          list->sf;
    /*
     * end time
     */
    if( list->ef >= list->fps ) {
      list->es += list->ef / list->fps;
      list->ef -= ( list->fps * (int)( list->ef / list->fps ) );
    }

    if( list->es >= 60  ) {
      list->em += list->es / 60;
      list->es -= ( 60  * ( list->es / 60  ) );
    }

    if( list->em >= 60  ) {
      list->eh += list->em / 60;
      list->em -= ( 60  * ( list->em / 60  ) );
    }

    t = list->eh * 3600.0 * list->fps + 
                list->em *   60.0 * list->fps + 
		            list->es * list->fps        + 
			          list->ef;
    list->etf = (int)(t+.5);
                
    /*
     * swap values if required
     */
    if( list->stf > list->etf ) {
      th = list->sh;
      tm = list->sm;
      ts = list->ss;
      tf = list->sf;
      list->sh = list->eh;
      list->sm = list->em;
      list->ss = list->es;
      list->sf = list->ef;
      list->eh = th;
      list->em = tm;
      list->es = ts;
      list->ef = tf;
      tf = list->stf;
      list->stf = list->etf;
      list->etf = tf;

      if( fc_verb )
        printf( "reverse\n" );
    }

    list = list->next;
  }
}

struct fc_time *
new_fc_time( )
{
  struct fc_time * time = NULL;

  if( ( time = (struct fc_time *)malloc( sizeof( struct fc_time ) ) ) == NULL ) {
    printf( "[%s:%d] malloc failure\n", __FILE__, __LINE__ );
    return NULL;
  }

  return time;
}

void
free_fc_time( struct fc_time * time )
{
  struct fc_time * temp;

  while( time != NULL ) {
    temp = time->next;
    free( time );
    time = temp;
  }
}

struct fc_time *
tail_fc_time( struct fc_time * tlist )
{
  struct fc_time * temp = tlist;

  while( temp != NULL && temp->next != NULL )
    temp = temp->next;

  return temp;
}

int
append_fc_time( struct fc_time * list, struct fc_time * time )
{
  struct fc_time * temp;
  int result = -1;

  if( list != NULL && ( temp = tail_fc_time( list ) ) != NULL ) {
    temp->next = time;
    result = 0;
  }

  return result;
}


